import Link from 'next/link'
import React, { useEffect, useState } from 'react'

function Layout({children}) {
    const [mobile,setMobile]=useState(false);
    const [open,setOpen]=useState(false);

    useEffect(()=>{
        const handelers=()=>{
            if(window.innerWidth<768){
                setMobile(true)
            } else{
                setMobile(false)
            }
        }

        window.addEventListener("resize",handelers)
        return ()=>{
            window.removeEventListener("resize",handelers)
        }
    },[])

    const openHandeler=()=>{
        setOpen(!open)
    }

    const icon="data:image/png;base64,";
    const instagram="data:image/jpeg;base64,";
    const linkdin="data:image/png;base64,";
    const github="data:image/png;base64,";
  return (
    <div className='max-w-[1400px] mx-auto'>
    <header className='flex justify-between bg-green-500 p-[15px]'>
        <div className='flex justify-between w-full items-center'>
            <Link href={"/"}>
            <img className='w-[50px] rounded-[90%] object-cover' src='data:image/png;base64,'/>
            </Link>
           {mobile&&<img src='data:image/jpeg;base64,' className='w-[40px] h-[35px] cursor-pointer rounded-[20%] relative' onClick={openHandeler}/>}
        </div>
        {open&&<div className='bg-gray-200 rounded-lg z-[100] top-[60px] text-center h-[100vh] w-[200px] right-0 absolute'>
            <div className='flex justify-center py-2 '>
                <img className='w-[60px] rounded-[50%]' src={icon} alt='/'/>
            </div>
            <div className='p-9 font-bold'>
                <Link href={"/"}>
            <p className='mt-9'>خانه</p>
                </Link>
            <Link href={"/menu"}>
            </Link>
            <Link href={"/catigurise"}>
            <p className='mt-9'>دسته بندی ها</p>
            </Link>
            <p className='mt-9'>درباره ما</p>
            </div>
            <div className='flex justify-evenly py-8 gap-4 items-center'>
                <button className='bg-green-500 p-2 text-white rounded-lg font-bold text-md'>ثبت نام</button>
                <button className='bg-blue-500 w-[60px] p-2 text-white rounded-lg font-bold text-md'>ورود</button>
            </div>
            <div className='flex justify-center gap-4'>
                <Link href={"https://github.com/Kamyarkamali?tab=repositories"}>
                <img className='w-[40px] cursor-pointer rounded-[50%]' src={github} alt='/'/>
                </Link>
                <Link href={"https://www.instagram.com/kamyr_02111/"}>
                <img className='w-[40px] cursor-pointer rounded-[50%]' src={instagram} alt='/'/>
                </Link>
                <Link href={"https://www.linkedin.com/in/kamyar-kamali-671a5822b/"}>
                <img className='w-[40px] cursor-pointer rounded-[50%]' src={linkdin} alt='/'/>
                </Link>
            </div>
        </div>}
        {!mobile&&<div className='flex items-center font-bold text-white text-2xl'>
        </div>}
        {!mobile&&<div className='flex items-center gap-4'>
            <Link href={"/menu"}>
            <button className='bg-orange-600 h-[60px] w-[100px] text-white p-[4px] rounded-lg font-bold hover:scale-105 duration-300'>منو غذاها</button>
            </Link>
            <Link href={"/catigurise"}>
            <button className='bg-orange-600 h-[60px] w-[100px] text-white p-[4px] rounded-lg font-bold hover:scale-105 duration-300'>دسته بندی ها</button>
            </Link>
            <Link href={"/"}>
            <button className='bg-blue-500 h-[60px] w-[100px] text-white p-[4px] rounded-lg font-bold hover:scale-105 duration-300'>صفحه اصلی</button>
            </Link>
        </div>}
    </header>

    <div className='min-h-[700px]'>{children}</div>

    <footer className=' bg-blue-600 max-w-[1600px]'>
        <div className='text-center font-bold text-gray-200 p-[25px]'>
            <h1>
                این سایت جهت نمایش نمونه کار توسط اینجانب طراحی شده
            </h1>
        </div>
    </footer>

    </div>
  )
}

export default Layout